import React, { useState, cloneElement, Children } from "react";

import * as styles from "@styles/maps.module.scss";

export const PathComponent = ({ id, selectedPath, setSelectedPath, onSelect, children }) => {
  const [fill, setFill] = useState("#C3E68E");
  const isSelected = selectedPath === id;
  const defaultFill = "#C3E68E";
  const hoverFill = "#91CB00";
  const selectedFill = "#91CB00";

  //const [fill, setFill] = useState(defaultFill);

  const handleMouseOver = () => {
    if (!isSelected) setFill(hoverFill);
  };

  const handleMouseLeave = () => {
    if (!isSelected) setFill(defaultFill);
  };

  const handleClick = () => {
    const newSelectedPath = isSelected ? null : id;
    setSelectedPath(newSelectedPath);
    onSelect(newSelectedPath);
  };

  const currentFill = isSelected ? selectedFill : defaultFill;

  return (
    <g
      onMouseOver={handleMouseOver}
      onMouseLeave={handleMouseLeave}
      onClick={handleClick}
      className={styles.stateHover}
    >
      {Children.map(children, (child) =>
        child.props.applyFill
          ? cloneElement(child, {
              fill: currentFill,
            })
          : child
      )}
    </g>
  )
}

